    "recipeIngredient": [
          "4 duck breasts"
          ,"1 Tbsp. of oil"
          ,"1/4 tsp of salt"
          ,"2 cloves of garlic"
          ,"1 tsp of soy sauce"
          ,"1 tsp of rice wine"
          ,"1 tsp of five-spice powder"
          ,"Cooked rice"
          ,"Cucumbers"
          ,"Scallions"
          ,"Hoisin sauce"
          ,"Flour tortillas"
    ],
    "recipeInstructions": [
        {
          "@type": "HowToStep",
          "text": "Place duck breast in pan to marinate."
        }
        ,{
          "@type": "HowToStep",
          "text": "Rub oil, salt, garlic, soy sauce, rice wine, and five-spice powder into the duck breasts. Let it marinate for 30 minutes."
        }
        ,{
          "@type": "HowToStep",
          "text": "Add one Tbsp. of oil to a hot skillet over medium heat. Add the duck breasts skin side down, cook until the skin is browned and crispy (can take up to 8-10 minutes, depending on your heat)."
        }
        ,{
          "@type": "HowToStep",
          "text": "Flip the duck so skin side is up. Place the skillet under the broiler for five minutes to further crisp the skin. Be careful not to burn the skin."
        }
        ,{
          "@type": "HowToStep",
          "text": "Remove from oven and let it rest for five minutes before slicing."
        }
        ,{
          "@type": "HowToStep",
          "text": "Spread hoisin sauce over the flour tortilla, layer on the rice, duck slices, cucumbers, and scallions."
        }
        ,{
          "@type": "HowToStep",
          "text": "Wrap it all up."
        }
        ,{
          "@type": "HowToStep",
          "text": "Enjoy!"
        }
    ],
