    "image": "https://img.buzzfeed.com/thumbnailer-prod-us-east-1/fc345157124248c883330e4d1641b45f/BFV31983_FrenchToast-FB.jpg",
    "name": "Overnight Praline French Toast Recipe by Tasty",
    "publisher": {
      "@type": "Organization",
      "name": "Tasty",
      "logo": {
        "@type": "ImageObject",
        "url": "/static-assets/img/favicon.b3bba8bf837f3cc2436736a18d4c4e6d.ico"
      }
    },
    "recipeIngredient": [
          "6 eggs"
          ,"2½ cups half &amp; half"
          ,"2 tablespoons brown sugar"
          ,"2 teaspoons vanilla extract"
          ,"Pinch of salt"
          ,"1 loaf bread such as brioche or challah, sliced 1-inch thick"
          ,"8 tablespoons butter, melted"
          ,"1 cup brown sugar"
          ,"1 cup pecans, chopped"
          ,"1 teaspoon ground cinnamon"
          ,"Pinch of ground nutmeg"
          ,"Pinch of salt"
          ,"Maple syrup, to serve"
    ],
    "recipeInstructions": [
        {
          "@type": "HowToStep",
          "text": "In a large bowl, add the eggs, half &amp; half, brown sugar, cinnamon, nutmeg, and pinch of salt. Whisk to combine."
        }
        ,{
          "@type": "HowToStep",
          "text": "Line bread in a greased 9x13-inch (23x33 cm) baking dish, overlapping slightly."
        }
        ,{
          "@type": "HowToStep",
          "text": "Pour the egg mixture over the bread."
        }
        ,{
          "@type": "HowToStep",
          "text": "Cover the baking dish in foil and refrigerate overnight."
        }
        ,{
          "@type": "HowToStep",
          "text": "Preheat oven to 350˚F (180˚C)."
        }
        ,{
          "@type": "HowToStep",
          "text": "In a bowl, add the butter, brown sugar, pecans, cinnamon, nutmeg, and salt. Stir to combine."
        }
        ,{
          "@type": "HowToStep",
          "text": "Remove the baking dish from the refrigerator and remove the foil. Top the French toast with the praline, and place foil back on"
        }
        ,{
          "@type": "HowToStep",
          "text": "Bake for 40 minutes. Remove foil, and bake for an additional 20 minutes, or until puffed and slightly golden."
        }
        ,{
          "@type": "HowToStep",
          "text": "Serve with maple syrup."
        }
        ,{
          "@type": "HowToStep",
          "text": "Enjoy!"
        }
    ],
