    "recipeIngredient": [
          "3 tablespoons oil"
          ,"400 grams chicken"
          ,"1 teaspoon salt"
          ,"1 teaspoon pepper"
          ,"200 grams onions, chopped"
          ,"100 grams carrots, chopped"
          ,"200 grams potatoes, chopped"
          ,"1 liter water"
          ,"100 grams peas"
          ,"150 grams curry paste"
    ],
    "recipeInstructions": [
        {
          "@type": "HowToStep",
          "text": "Heat up 2 tablespoons of oil on low to medium heat."
        }
        ,{
          "@type": "HowToStep",
          "text": "Sear the chicken until the outside turns golden brown. Season with salt and pepper."
        }
        ,{
          "@type": "HowToStep",
          "text": "Take out the chicken, make sure you don’t clean the pot or you’d wipe away some deliciousness!"
        }
        ,{
          "@type": "HowToStep",
          "text": "Add another tablespoon of oil, fry the onions, carrots, and potatoes until soften."
        }
        ,{
          "@type": "HowToStep",
          "text": "Add the chicken back in with the water. Bring to a boil then simmer for 10 minutes with the lid on."
        }
        ,{
          "@type": "HowToStep",
          "text": "Add in the peas and curry paste, stir well."
        }
        ,{
          "@type": "HowToStep",
          "text": "Serve with rice."
        }
        ,{
          "@type": "HowToStep",
          "text": "Enjoy!"
        }
    ],
