    "@type": "Recipe",
    "author": [
      {
        "@type": "Person",
        "name": "Frank Tiu"
      }
    ],
    "datePublished": "2018-12-20T23:11:49",
    "description": "Here's what you need: unsalted butter, sugar, large egg, large egg yolk, almond extract, all-purpose flour, baking soda, kosher salt, water, red food coloring",
    "image": "https://img.buzzfeed.com/thumbnailer-prod-us-east-1/video-api/assets/197912.jpg",
    "name": "Chinese Almond Cookies Recipe by Tasty",
    "publisher": {
      "@type": "Organization",
      "name": "Tasty",
      "logo": {
        "@type": "ImageObject",
        "url": "/static-assets/img/favicon.b3bba8bf837f3cc2436736a18d4c4e6d.ico"
      }
    },
    "recipeIngredient": [
          "1 cup (2 sticks) unsalted butter, room temperature"
          ,"1½ cups sugar"
          ,"1 large egg"
          ,"2 large egg yolks, divided"
          ,"2 teaspoons almond extract"
          ,"3 cups all-purpose flour"
          ,"1 teaspoon baking soda"
          ,"½ teaspoon kosher salt"
          ,"1 teaspoon water"
          ,"1 teaspoon red food coloring"
    ],
    "recipeInstructions": [
        {
          "@type": "HowToStep",
          "text": "In a large bowl, cream the butter and sugar together with an electric hand mixer for 5 minutes, or until light and fluffy."
        }
        ,{
          "@type": "HowToStep",
          "text": "Add the egg, then 1 egg yolk, beating to incorporate after each addition."
        }
        ,{
          "@type": "HowToStep",
          "text": "Add the almond extract and beat to combine."
        }
        ,{
          "@type": "HowToStep",
          "text": "Sift the flour, baking soda, and salt into the bowl and beat for 3 minutes, or until a crumbly dough forms."
        }
        ,{
          "@type": "HowToStep",
          "text": "Turn out the dough onto a sheet of plastic wrap and fold the wrap over the dough on all 4 sides to create a square dough block about ½ inch (1 ¼ cm) thick. Refrigerate the dough for 2 hours."
        }
        ,{
          "@type": "HowToStep",
          "text": "Preheat the oven to 325˚F (165˚C). Line a baking sheet with parchment paper."
        }
        ,{
          "@type": "HowToStep",
          "text": "Unwrap the dough on a cutting board and cut into 25 cubes."
        }
        ,{
          "@type": "HowToStep",
          "text": "Roll the dough cubes into balls, then flatten slightly and place on the prepared baking sheet."
        }
        ,{
          "@type": "HowToStep",
          "text": "In a small bowl, beat the remaining egg yolk with the water."
        }
        ,{
          "@type": "HowToStep",
          "text": "Brush a thick layer of egg wash onto the cookies."
        }
        ,{
          "@type": "HowToStep",
          "text": "Add the red food coloring to a small bowl. Dip the thicker end of a wooden chopstick into the food coloring and make a dot in the center of each cookie."
        }
        ,{
          "@type": "HowToStep",
          "text": "Bake for 35 minutes, or until the cookies are golden."
        }
        ,{
          "@type": "HowToStep",
          "text": "Let the cookies cool on a wire rack for 30 minutes before serving."
        }
        ,{
          "@type": "HowToStep",
          "text": "Enjoy!"
        }
    ],
