    "description": "Here's what you need: olive oil, chicken breast, andouille sausage, garlic, jalapeño pepper, white onion, red bell pepper, yellow bell pepper, green bell pepper, celery, chicken stock, tomato, rice, cajun seasoning, bay leaf, dried thyme, cayenne pepper, shrimp, salt, pepper",
    "image": "https://img.buzzfeed.com/thumbnailer-prod-us-east-1/c4f772a4f9fe45fdb3ac54ca6bb4de90/BFV4107_Jambalaya_FB1080SQ.jpg",
    "name": "Easy Jambalaya Recipe by Tasty",
    "publisher": {
      "@type": "Organization",
      "name": "Tasty",
      "logo": {
        "@type": "ImageObject",
        "url": "/static-assets/img/favicon.b3bba8bf837f3cc2436736a18d4c4e6d.ico"
      }
    },
    "recipeIngredient": [
          "- 2 Tbsp. olive oil"
          ,"- 2 chicken breasts"
          ,"- 1lb Andouille sausage"
          ,"- 4 cloves garlic"
          ,"- 1 jalapeno pepper"
          ,"- 1 white onion"
          ,"- 1 red pepper"
          ,"- 1 yellow pepper"
          ,"- 1 green pepper"
          ,"- 2 ribs celery"
          ,"- 3 cups chicken stock"
          ,"- 14oz crushed tomatoes"
          ,"- 1 1/2 cups of rice"
          ,"- 2 Tbsp. cajun seasoning"
          ,"- 1 bay leaf"
          ,"- 1 tsp dried thyme"
          ,"- 1/2 tsp cayenne pepper"
          ,"- 1lb shrimp"
          ,"- salt to taste"
          ,"- pepper to taste"
    ],
    "recipeInstructions": [
        {
          "@type": "HowToStep",
          "text": "Heat olive oil in a large pot over medium high heat. Add diced chicken breasts and Andouille sausage. Add salt and pepper to taste, and cook thoroughly."
        }
        ,{
          "@type": "HowToStep",
          "text": "Add crushed garlic and a diced jalapeño pepper."
        }
        ,{
          "@type": "HowToStep",
          "text": "NOTE: Leave the jalapeño seeds in for extra spice"
        }
        ,{
          "@type": "HowToStep",
          "text": "Stir in diced onion, peppers, celery until they’re soft."
        }
        ,{
          "@type": "HowToStep",
          "text": "Add chicken stock, tomatoes, rice, cajun seasoning, bay leaf, dried thyme, cayenne pepper and stir."
        }
        ,{
          "@type": "HowToStep",
          "text": "Cover and simmer stew for 30 minutes."
        }
        ,{
          "@type": "HowToStep",
          "text": "NOTE: Stir occasionally to make sure the rice doesn’t burn at the bottom of the pan."
        }
        ,{
          "@type": "HowToStep",
          "text": "Once the rice is cooked, add in shrimp, season with salt and pepper, then continue simmering until the shrimp are cooked through."
        }
        ,{
          "@type": "HowToStep",
          "text": "Enjoy!"
        }
    ],
