    "datePublished": "2018-02-08T23:51:20",
    "description": "Here's what you need: french bread dough, mayonnaise, mustard, sliced provolone cheese, sliced deli cheese, sliced deli turkey, sliced deli roast beef, sliced deli ham, bacon, romaine lettuce, salami, pepperoni, tomato, ranch dressing",
    "image": "https://img.buzzfeed.com/thumbnailer-prod-us-east-1/video-api/assets/136057.jpg",
    "name": "4-Flavor Sandwich Ring Recipe by Tasty",
    "publisher": {
      "@type": "Organization",
      "name": "Tasty",
      "logo": {
        "@type": "ImageObject",
        "url": "/static-assets/img/favicon.b3bba8bf837f3cc2436736a18d4c4e6d.ico"
      }
    },
    "recipeIngredient": [
          "2 11-ounce packages French bread dough"
          ,"4 tablespoons mayonnaise, divided"
          ,"2 tablespoons mustard, divided"
          ,"¼ pound sliced provolone cheese"
          ,"¼ pound sliced deli cheese"
          ,"¼ pound sliced deli turkey"
          ,"¼ pound sliced deli roast beef"
          ,"½ pound sliced deli ham"
          ,"4 cooked bacon slices, halved"
          ,"10 pieces romaine lettuce, rinsed and dried"
          ,"3 slices salami"
          ,"4 slices pepperoni"
          ,"1 tomato, sliced, divided"
          ,"1 tablespoon ranch dressing"
    ],
    "recipeInstructions": [
        {
          "@type": "HowToStep",
          "text": "Preheat oven to 350˚F (180˚C)"
        }
        ,{
          "@type": "HowToStep",
          "text": "Spray a bundt pan with cooking spray and place both pieces of French bread dough into the bundt pan, pressing the edges together."
        }
        ,{
          "@type": "HowToStep",
          "text": "Bake for 20-25 minutes, or until the crust is golden brown. Cool completely, and carefully slice in half. Place the top half aside during assembly."
        }
        ,{
          "@type": "HowToStep",
          "text": "Visually separate the round bread into four quarters. The first quarter is on the top left, second, top right, third, bottom left, and fourth, bottom right. Spread mayonnaise on all four quarters of the bottom slice of bread. Then, spread mustard on quarters 2 and 3."
        }
        ,{
          "@type": "HowToStep",
          "text": "Place slices of provolone cheese on quarters 1 and 3, followed by cheddar cheese on quarters 2 and 4. Place deli turkey slices on quarter 1 and roast beef slices on quarter 2. Put deli ham slices on quarters 3 and 4."
        }
        ,{
          "@type": "HowToStep",
          "text": "Add bacon slices on top of the turkey in quarter 1, then lettuce on quarters 2 and 4. Add salami and pepperoni slices to quarter 3."
        }
        ,{
          "@type": "HowToStep",
          "text": "Finish off the first quarter with some tomato slices, ranch dressing, and lettuce. Spread mustard on top of the lettuce of quarter 2, and mayonnaise onto the lettuce of quarter 8."
        }
        ,{
          "@type": "HowToStep",
          "text": "Add tomatoes and lettuce to finish off quarter 3. Place the reserved piece of bread on top and carefully cut the ring into sandwiches. It may help to use toothpicks to hold the sandwiches together."
        }
        ,{
          "@type": "HowToStep",
          "text": "Enjoy!"
        }
    ],
