        {
          "@type": "HowToStep",
          "text": "Bring a medium pot with about 1 cup (240 ml) of water, just enough to cover the bottom of the pan by an inch (2 cm), to a boil."
        }
        ,{
          "@type": "HowToStep",
          "text": "Add the beaten egg to a ramekin and sprinkle in a pinch of salt."
        }
        ,{
          "@type": "HowToStep",
          "text": "While slowly stirring with a fork, pour in the remaining water."
        }
        ,{
          "@type": "HowToStep",
          "text": "Cover with foil and place the ramekin into the boiling water. Cover and steam for 12 minutes. Uncover, carefully remove the ramekin, and take off the foil."
        }
        ,{
          "@type": "HowToStep",
          "text": "Top with chives if you like."
        }
        ,{
          "@type": "HowToStep",
          "text": "Enjoy!"
        }
