          "6 tablespoons soy sauce"
          ,"1 tablespoon hoisin sauce"
          ,"1 tablespoon rice vinegar"
          ,"2 tablespoons honey"
          ,"1 teaspoon sesame oil"
          ,"½ tablespoon ginger, minced"
          ,"2 cloves garlic, minced"
          ,"¾ pounds chicken breasts, cut into 1-inch pieces"
