    "description": "Here's what you need: duck leg, boiling water, soft brown sugar, rice vinegar, spring onion, ginger, salt, five spice, soft brown sugar, chinese pancake, hoisin sauce, spring onion, cucumber",
    "image": "https://img.buzzfeed.com/video-api-prod/assets/bbed3285a7494fa398bf377a1ba93d7d/FB.jpg",
    "name": "Homemade Chinese-Style Crispy Duck In A Pancake Recipe by Tasty",
    "publisher": {
      "@type": "Organization",
      "name": "Tasty",
      "logo": {
        "@type": "ImageObject",
        "url": "/static-assets/img/favicon.b3bba8bf837f3cc2436736a18d4c4e6d.ico"
      }
    },
    "recipeIngredient": [
          "2 duck legs"
          ,"1 liter boiling water"
          ,"6 tablespoons soft brown sugar"
          ,"150 milliliters rice vinegar"
          ,"75 grams spring onion, chopped"
          ,"25 grams ginger, finely diced"
          ,"4 tablespoons salt"
          ,"2 tablespoons five spice"
          ,"2 tablespoons soft brown sugar"
          ,"12 Chinese pancakes"
          ,"60 grams hoisin sauce"
          ,"4 spring onions, shredded"
          ,"1 cucumber, thinly sliced"
    ],
    "recipeInstructions": [
        {
          "@type": "HowToStep",
          "text": "Lightly score into the skin of the duck legs."
        }
        ,{
          "@type": "HowToStep",
          "text": "In boiling hot water, add vinegar and sugar. Stir."
        }
        ,{
          "@type": "HowToStep",
          "text": "Submerge the duck legs in the glaze mix for 20 seconds."
        }
        ,{
          "@type": "HowToStep",
          "text": "Preheat the oven to 160°C (320°F)."
        }
        ,{
          "@type": "HowToStep",
          "text": "Pad dry the duck legs with kitchen roll."
        }
        ,{
          "@type": "HowToStep",
          "text": "Mix well all the marinade ingredients."
        }
        ,{
          "@type": "HowToStep",
          "text": "Give the duck legs a good rub in the marinade."
        }
        ,{
          "@type": "HowToStep",
          "text": "On a cooling rack set over a baking tray, place a bed of the marinade then put the duck legs on top. Make sure they are skin side up."
        }
        ,{
          "@type": "HowToStep",
          "text": "Roast the duck legs for 30 minutes on 160°C (320°F)."
        }
        ,{
          "@type": "HowToStep",
          "text": "Turn up the oven to 200°C (400˚F) and roast the duck for another 20 minutes."
        }
        ,{
          "@type": "HowToStep",
          "text": "Rest the duck legs for 10 minutes, then shred them with two forks."
        }
        ,{
          "@type": "HowToStep",
          "text": "Serve with Chinese pancakes, hoisin sauce, shredded spring onions, and sliced cucumber."
        }
        ,{
          "@type": "HowToStep",
          "text": "Enjoy!"
        }
    ],
