    "description": "Here's what you need: large egg, milk, maple syrup, vanilla extract, ground cinnamon, salt, whole wheat bread, powdered sugar",
    "image": "https://img.buzzfeed.com/thumbnailer-prod-us-east-1/85e3b2cb2b3f47c7bb662e7036c15fc1/BFV37599_TheGriddlerBatchBreakfasts_FB.jpg",
    "name": "Whole Wheat French Toast Recipe by Tasty",
    "publisher": {
      "@type": "Organization",
      "name": "Tasty",
      "logo": {
        "@type": "ImageObject",
        "url": "/static-assets/img/favicon.b3bba8bf837f3cc2436736a18d4c4e6d.ico"
      }
    },
    "recipeIngredient": [
          "2 large eggs"
          ,"1 cup milk of choice"
          ,"2 tablespoons maple syrup, plus more for serving"
          ,"1 teaspoon vanilla extract"
          ,"1 teaspoon ground cinnamon"
          ,"Salt, to taste"
          ,"8 slices whole wheat bread"
          ,"Powdered sugar, for sprinkling"
    ],
    "recipeInstructions": [
        {
          "@type": "HowToStep",
          "text": "Preheat Griddler, fitted with the griddle plates, to 375°F (190°C), and grease with nonstick spray."
        }
        ,{
          "@type": "HowToStep",
          "text": "Use a whisk to beat the eggs in a 9x13-inch (23x33-cm) casserole dish until smooth."
        }
        ,{
          "@type": "HowToStep",
          "text": "Add the milk, maple syrup, vanilla, cinnamon, and salt, and whisk until smooth and well combined."
        }
        ,{
          "@type": "HowToStep",
          "text": "Dunk the bread in the batter, 4 slices at a time, until just soaked. Do not let the bread soak in the wet ingredients too long or it will become too wet and fall apart when you attempt to pick it up."
        }
        ,{
          "@type": "HowToStep",
          "text": "Transfer the soaked bread to the Griddler and cook for 10 minutes."
        }
        ,{
          "@type": "HowToStep",
          "text": "Sprinkle with powdered sugar, drizzle with maple syrup, and serve."
        }
        ,{
          "@type": "HowToStep",
          "text": "Enjoy!"
        }
    ],
