    "description": "Here's what you need: cream cheese, sugar, cinnamon, egg, heavy cream, french bread, blueberry, maple syrup",
    "image": "https://img.buzzfeed.com/video-api-prod/assets/d1b613109c0445f8b4d73897031e08fe/BFV13846_FrenchToastBoat-ThumbTextless1080.jpg",
    "name": "Blueberry French Toast Boat Recipe by Tasty",
    "publisher": {
      "@type": "Organization",
      "name": "Tasty",
      "logo": {
        "@type": "ImageObject",
        "url": "/static-assets/img/favicon.b3bba8bf837f3cc2436736a18d4c4e6d.ico"
      }
    },
    "recipeIngredient": [
          "4 ounces cream cheese, softened"
          ,"¼ cup sugar"
          ,"1 teaspoon cinnamon"
          ,"4 eggs"
          ,"½ cup heavy cream"
          ,"1 loaf french bread (14-16 ounce loaf)"
          ,"1 cup blueberries"
          ,"Maple syrup, to dip"
    ],
    "recipeInstructions": [
        {
          "@type": "HowToStep",
          "text": "In a bowl, combine softened cream cheese, sugar, and cinnamon."
        }
        ,{
          "@type": "HowToStep",
          "text": "Add eggs and heavy cream and whisk until well combined. Set aside."
        }
        ,{
          "@type": "HowToStep",
          "text": "Preheat oven to 400˚F (200˚C)."
        }
        ,{
          "@type": "HowToStep",
          "text": "Cut a rectangle along the top of the loaf of french bread and pull out the part you cut along with the soft inside of the loaf. Set the “bread boat” aside."
        }
        ,{
          "@type": "HowToStep",
          "text": "Tear apart the rectangle and soft inside of the bread that you removed into little bite-size pieces."
        }
        ,{
          "@type": "HowToStep",
          "text": "Gently, fold the bread pieces and blueberries into the egg mixture until all of the liquid is absorbed."
        }
        ,{
          "@type": "HowToStep",
          "text": "Place the “bread boat” on a baking sheet lined with parchment paper and pour in the bread and egg mixture."
        }
        ,{
          "@type": "HowToStep",
          "text": "Bake for 30-40 minutes or until the top is golden brown. If the top is browning too quickly, cover the top of the boat in foil for the remaining time."
        }
        ,{
          "@type": "HowToStep",
          "text": "Let cool before cutting into slices and serve with maple syrup."
        }
        ,{
          "@type": "HowToStep",
          "text": "Enjoy!"
        }
    ],
