          "Canola oil, to fry"
          ,"1 pound flank steak"
          ,"1 teaspoon taco seasoning"
          ,"2 teaspoons lime juice, divided"
          ,"2 teaspoons salt, divided"
          ,"2 avocados"
          ,"1 bag frozen french fries"
          ,"¼ cup Mexican sour cream"
          ,"1 8 ounce bags of flaming hot cheetos"
