    "recipeIngredient": [
          "4 chicken thighs"
          ,"Salt, to season"
          ,"Pepper, to season"
          ,"Mixed herbs, to season"
          ,"3 shallots, chopped"
          ,"40 garlic cloves, unpeeled"
          ,"120 milliliters dry vermouth or white wine"
          ,"3 sprigs fresh parsley"
          ,"1 teaspoon dried tarragon"
          ,"180 millilitres chicken stock"
    ],
    "recipeInstructions": [
        {
          "@type": "HowToStep",
          "text": "Pre-heat the oven to 180°C (350°F)"
        }
        ,{
          "@type": "HowToStep",
          "text": "Season the chicken with the salt, pepper and mixed herbs. Set aside."
        }
        ,{
          "@type": "HowToStep",
          "text": "Heat some oil in a large pan and sear the chicken for about 10-15 minutes evenly on each side, until golden brown."
        }
        ,{
          "@type": "HowToStep",
          "text": "Take the chicken out and set aside."
        }
        ,{
          "@type": "HowToStep",
          "text": "Add the shallots and cook down in the remaining juices for about 5 minutes over a low-medium heat."
        }
        ,{
          "@type": "HowToStep",
          "text": "Add the garlic cloves and gently cook them for about 2 minutes."
        }
        ,{
          "@type": "HowToStep",
          "text": "Pour in the vermouth or white wine and gently cook so that it reduces slightly."
        }
        ,{
          "@type": "HowToStep",
          "text": "Add the chicken, parsley sprigs and tarragon, followed by the chicken stock."
        }
        ,{
          "@type": "HowToStep",
          "text": "Bake in the oven for 20-25 minutes or until the chicken is cooked through."
        }
        ,{
          "@type": "HowToStep",
          "text": "Serve with crusty bread and vegetables of your choice."
        }
        ,{
          "@type": "HowToStep",
          "text": "Enjoy!"
        }
    ],
