    "recipeIngredient": [
          "4 chicken breasts"
          ,"150g ball of mozzarella"
          ,"1/2 jar sun-dried tomatoes"
          ,"30g fresh basil leaves"
          ,"Salt"
          ,"Black pepper"
          ,"Dried oregano"
          ,"Cocktail sticks"
    ],
    "recipeInstructions": [
        {
          "@type": "HowToStep",
          "text": "Preheat your oven to 400°F, Gas Mark 6 (200°C.)"
        }
        ,{
          "@type": "HowToStep",
          "text": "Dice the mozzarella and sun-dried tomatoes into small pieces and tear the basil leaves."
        }
        ,{
          "@type": "HowToStep",
          "text": "Season the chicken breasts with salt, pepper and dried oregano."
        }
        ,{
          "@type": "HowToStep",
          "text": "Cut a very deep slit lengthways into the chicken, but do not cut all the way through - spread it out a bit if necessary to give you more room to work with."
        }
        ,{
          "@type": "HowToStep",
          "text": "Stuff to the brim with the fillings"
        }
        ,{
          "@type": "HowToStep",
          "text": "Use a few cocktail sticks to hold the chicken together and place on a baking tray."
        }
        ,{
          "@type": "HowToStep",
          "text": "Pour a tablespoon of the oil from the sun-dried tomatoes jar over each chicken breast."
        }
        ,{
          "@type": "HowToStep",
          "text": "Bake in the center of the oven for 20-25 minutes until cooked through and the juices run clear."
        }
        ,{
          "@type": "HowToStep",
          "text": "Remove the cocktail sticks."
        }
        ,{
          "@type": "HowToStep",
          "text": "Enjoy!"
        }
    ],
