    "description": "Here's what you need: black eyed pea, BBQ sauce, seasoned salt, egg, panko breadcrumbs, kale, cornbread batter, mayonnaise, dijon mustard, hot sauce, garlic, mason jar lid rings",
    "image": "https://img.buzzfeed.com/video-api-prod/assets/ff4e6f7d13e548339b45fff53c0a72e8/BFV11925_MasonJarCornbreadBurger-ThumbTextless1080.jpg",
