    "description": "Here's what you need: duck breast, salt, pepper, fingerling potato, fresh rosemary, red wine, chicken stock, orange, honey",
    "image": "https://img.buzzfeed.com/thumbnailer-prod-us-east-1/video-api/assets/122093.jpg",
    "name": "Seared Crispy Skin Duck Breast With Duck Fat Fried Potatoes Recipe by Tasty",
    "publisher": {
      "@type": "Organization",
      "name": "Tasty",
      "logo": {
        "@type": "ImageObject",
        "url": "/static-assets/img/favicon.b3bba8bf837f3cc2436736a18d4c4e6d.ico"
      }
    },
    "recipeIngredient": [
          "2 1-pound duck breasts"
          ,"Salt, to taste"
          ,"Pepper, to taste"
          ,"1 pound fingerling potatoes"
          ,"1 sprig rosemary"
          ,"1 cup red wine"
          ,"1 cup chicken stock"
          ,"½ orange"
          ,"2 tablespoons honey"
    ],
    "recipeInstructions": [
        {
          "@type": "HowToStep",
          "text": "Pat dry the duck breasts with a paper towel."
        }
        ,{
          "@type": "HowToStep",
          "text": "Score the duck skin with sharp knife, making sure to not cut into the flesh."
        }
        ,{
          "@type": "HowToStep",
          "text": "Season the duck breasts on both sides with salt and pepper."
        }
        ,{
          "@type": "HowToStep",
          "text": "Add the potatoes to a pot of water and bring to a boil over high heat. Cook for 15-20 minutes, until fork-tender. Drain the potatoes in a colander."
        }
        ,{
          "@type": "HowToStep",
          "text": "Using the bottom of a ramekin or your palm, gently smash the potatoes."
        }
        ,{
          "@type": "HowToStep",
          "text": "Preheat the oven to 400˚F (200˚C)."
        }
        ,{
          "@type": "HowToStep",
          "text": "Starting with a cold and dry oven-safe skillet, place the duck breasts skin side down. Cook for 12-15 minutes over medium heat."
        }
        ,{
          "@type": "HowToStep",
          "text": "Flip the breasts over and sear the other side for 1 minute. Flip to the skin side down, and transfer the skillet to the oven."
        }
        ,{
          "@type": "HowToStep",
          "text": "Roast for 4 minutes for medium-rare, or 6 minutes for medium."
        }
        ,{
          "@type": "HowToStep",
          "text": "Rest the duck skin-side up for 10 minutes. Do not discard the fat in the pan."
        }
        ,{
          "@type": "HowToStep",
          "text": "In a small pot, combine the red wine, chicken stock, orange juice, and honey and reduce by half over medium heat."
        }
        ,{
          "@type": "HowToStep",
          "text": "Fry the potatoes with remaining duck fat in the pan, until golden brown, 5-6 minutes. Season with salt, pepper and rosemary."
        }
        ,{
          "@type": "HowToStep",
          "text": "Slice the duck ½-inch (1 cm) pieces."
        }
        ,{
          "@type": "HowToStep",
          "text": "Serve with the sauce and the potatoes."
        }
        ,{
          "@type": "HowToStep",
          "text": "Enjoy!"
        }
    ],
