    "recipeIngredient": [
          "250 milliliters milk"
          ,"150 milliliters double cream"
          ,"1 onion, roughly chopped"
          ,"2 cloves garlic, crushed"
          ,"2 bay leaves"
          ,"25 grams butter"
          ,"25 grams flour"
          ,"1 teaspoon dijon mustard"
          ,"Pinch of ground nutmeg"
          ,"4 slices white bread"
          ,"25 grams butter, melted"
          ,"Dijon mustard, to spread"
          ,"100 grams Gruyère cheese, grated"
          ,"6 slices ham"
    ],
    "recipeInstructions": [
        {
          "@type": "HowToStep",
          "text": "In a saucepan, combine the milk, double cream, onion, garlic and bay leaves and heat over a medium heat until it just starts to boil."
        }
        ,{
          "@type": "HowToStep",
          "text": "Take off the heat and leave to infuse for 10 minutes."
        }
        ,{
          "@type": "HowToStep",
          "text": "Pour the milk mixture through a sieve into a jug."
        }
        ,{
          "@type": "HowToStep",
          "text": "Then, in a saucepan, gently melt the butter and add the flour. Stir together over a low-medium heat for 1 -2 minutes."
        }
        ,{
          "@type": "HowToStep",
          "text": "Gradually add the milk in three parts whilst continually stirring."
        }
        ,{
          "@type": "HowToStep",
          "text": "Continue to stir and bring the sauce to a gentle boil."
        }
        ,{
          "@type": "HowToStep",
          "text": "Take off the heat and stir in the dijon mustard and ground nutmeg."
        }
        ,{
          "@type": "HowToStep",
          "text": "Next, brush the two slices of bread with the melted butter and grill for about 5 minutes until golden brown."
        }
        ,{
          "@type": "HowToStep",
          "text": "Take out of the grill and preheat the heat the oven to 180°C (350°F)."
        }
        ,{
          "@type": "HowToStep",
          "text": "Flip the slices of bread over and spread one slice with a thin layer of dijon mustard, followed by another layer of the béchamel sauce, followed by the cheese and then the ham."
        }
        ,{
          "@type": "HowToStep",
          "text": "Place the other slice of bread on top and coat with more béchamel sauce and cheese."
        }
        ,{
          "@type": "HowToStep",
          "text": "Bake for about 15 minutes, until the cheese is bubbling."
        }
        ,{
          "@type": "HowToStep",
          "text": "Serve with fresh salad!"
        }
        ,{
          "@type": "HowToStep",
          "text": "Enjoy!"
        }
    ],
