    "recipeIngredient": [
          "5 medium russet potatoes"
          ,"2 tablespoon all-purpose flour"
          ,"2 cloves garlic, minced"
          ,"¼ cup grated Parmesan cheese"
          ,"1 teaspoon salt"
          ,"½ teaspoon pepper"
          ,"1 cup heavy cream"
          ,"3 cups shredded cheddar cheese"
          ,"3 cups shredded Gruyère cheese"
          ,"9 slices ham"
          ,"Chopped fresh parsley, for garnish"
    ],
    "recipeInstructions": [
        {
          "@type": "HowToStep",
          "text": "Preheat the oven to 375˚F (190˚C)."
        }
        ,{
          "@type": "HowToStep",
          "text": "Using a mandolin or a sharp knife, thinly slice the potatoes lengthwise."
        }
        ,{
          "@type": "HowToStep",
          "text": "In a 13-inch (33-cm) cast iron skillet, layer slices of potatoes around the outside of the pan. Add another layer of potatoes, keeping them centered in the pan and moving clockwise until the pan is covered."
        }
        ,{
          "@type": "HowToStep",
          "text": "Top with a third of the cheddar cheese, a third of the Gruyère cheese, and half of the ham."
        }
        ,{
          "@type": "HowToStep",
          "text": "Add another layer of potato slices around the outside of the pan, then a add layer of slices around the center of the pan. Top with another third of the cheddar and Gruyère and the remaining ham slices."
        }
        ,{
          "@type": "HowToStep",
          "text": "Add a final layer of potato slices around the center of the pan"
        }
        ,{
          "@type": "HowToStep",
          "text": "Top with the remaining cheddar and Gruyère cheese."
        }
        ,{
          "@type": "HowToStep",
          "text": "Cover with greased aluminum foil and bake for 40 minutes."
        }
        ,{
          "@type": "HowToStep",
          "text": "Remove the pan from the oven and increase the oven temperature to 400˚F (200˚C)."
        }
        ,{
          "@type": "HowToStep",
          "text": "In a medium bowl, combine the flour, garlic, Parmesan, salt, pepper and mix well."
        }
        ,{
          "@type": "HowToStep",
          "text": "Slowly add in the cream, whisking until fully incorporated."
        }
        ,{
          "@type": "HowToStep",
          "text": "Uncover the skillet and pour the cream mixture over potatoes, spreading evenly."
        }
        ,{
          "@type": "HowToStep",
          "text": "Bake for another 10-15 minutes uncovered, until the cheese is melted and golden brown."
        }
        ,{
          "@type": "HowToStep",
          "text": "Cool for at least 30 minutes, then slice and serve."
        }
        ,{
          "@type": "HowToStep",
          "text": "Garnish with fresh parsley."
        }
        ,{
          "@type": "HowToStep",
          "text": "Enjoy!"
        }
    ],
