    "description": "Here's what you need: center-cut beef tenderloin, kosher salt, black pepper, canola oil, english mustard, butter, shallot, cremini mushroom, garlic, prosciutto, puff pastry, egg",
    "image": "https://img.buzzfeed.com/thumbnailer-prod-us-east-1/video-api/assets/114506.jpg",
    "name": "Show-Stopping Beef Wellington Recipe by Tasty",
    "publisher": {
      "@type": "Organization",
      "name": "Tasty",
      "logo": {
        "@type": "ImageObject",
        "url": "/static-assets/img/favicon.b3bba8bf837f3cc2436736a18d4c4e6d.ico"
      }
    },
    "recipeIngredient": [
          "1 3-poumd center-cut beef tenderloin"
          ,"Kosher salt, to taste"
          ,"Black pepper, to taste"
          ,"2 tablespoons canola oil"
          ,"¼ cup English mustard"
          ,"1 tablespoon butter"
          ,"2 shallots, minced"
          ,"2 pounds cremini mushrooms, minced"
          ,"5 cloves garlic, minced"
          ,"½ pound prosciutto, thinly sliced"
          ,"1 sheet puff pastry"
          ,"2 eggs, beaten"
    ],
    "recipeInstructions": [
        {
          "@type": "HowToStep",
          "text": "Let the beef tenderloin come to room temperature. Season with kosher salt and pepper on all sides."
        }
        ,{
          "@type": "HowToStep",
          "text": "Add canola oil to a large pan on high heat. Once the oil is hot, add the tenderloin. Without moving the tenderloin, cook until a dark brown crust forms, about 3 minutes per side. Repeat searing on all sides, including the tenderloin ends."
        }
        ,{
          "@type": "HowToStep",
          "text": "Remove the tenderloin from the pan and transfer to a cutting board or wire rack and remove ties."
        }
        ,{
          "@type": "HowToStep",
          "text": "Brush the mustard on all sides of the meat while it’s still warm. Let the meat rest for while making the duxelle (mushrooms cooked and reduced until dry)."
        }
        ,{
          "@type": "HowToStep",
          "text": "To the same pan, add the butter, mushrooms, minced shallot, and minced garlic over medium-high heat. Cook, stirring occasionally, until all the liquid evaporates and the mushroom mixture becomes a thick 25-30 minutes, dry-like paste. Season with salt and pepper to taste."
        }
        ,{
          "@type": "HowToStep",
          "text": "Remove the mushrooms from the pan and let cool completely."
        }
        ,{
          "@type": "HowToStep",
          "text": "Place a large layer of overlapping sheets of plastic wrap on your work surface that is twice the length and width of the tenderloin."
        }
        ,{
          "@type": "HowToStep",
          "text": "Lay overlapping strips of prosciutto on the plastic into an even square layer."
        }
        ,{
          "@type": "HowToStep",
          "text": "Spread a layer of the mushrooms evenly over the prosciutto."
        }
        ,{
          "@type": "HowToStep",
          "text": "Tightly and evenly wrap the tenderloin with the prosciutto, using the plastic wrap to wrap it even tighter and seal ends. Tie the ends of the plastic wrap together to hold the Wellington’s shape. Place in the refrigerator for 15 minutes."
        }
        ,{
          "@type": "HowToStep",
          "text": "Preheat oven to 400°F (200°C)."
        }
        ,{
          "@type": "HowToStep",
          "text": "Place a new layer of plastic wrap on the work surface and lay a sheet of puff pastry over it. Unwrap the prosciutto-wrapped beef tenderloin onto the puff pastry, wrapping until the ends meet. Cut off any extra puff pastry, making sure there is no overlap."
        }
        ,{
          "@type": "HowToStep",
          "text": "Wrap the puff pastry in plastic wrap, tying the ends together to form a log shape. Place in the refrigerator for 15 minutes."
        }
        ,{
          "@type": "HowToStep",
          "text": "Place the beef Wellington on a greased, parchment paper-lined baking sheet. Brush the surface with the beaten eggs. With a fork, score a decorative design onto the surface of the puff pastry."
        }
        ,{
          "@type": "HowToStep",
          "text": "Decorate with additional pastry (optional). Sprinkle with kosher salt."
        }
        ,{
          "@type": "HowToStep",
          "text": "Bake for 40 minutes or until the puff pastry is a dark golden brown and the internal temperature of the beef is 135°F (57°C) for medium-rare."
        }
        ,{
          "@type": "HowToStep",
          "text": "Enjoy!"
        }
    ],
