    "recipeIngredient": [
          "1 banana, thinly sliced"
          ,"2 slices of thick bread"
          ,"5 digestives"
          ,"4 tablespoons caramel sauce"
          ,"2 eggs"
          ,"1 knob of butter, for frying"
          ,"Whipped cream"
          ,"Grated chocolate"
    ],
    "recipeInstructions": [
        {
          "@type": "HowToStep",
          "text": "Smash the biscuits into fine crumbs, using a blender or the bag and rolling pin method. "
        }
        ,{
          "@type": "HowToStep",
          "text": "Pour into a bowl and set aside for later."
        }
        ,{
          "@type": "HowToStep",
          "text": "Stretch and thin out the bread a bit using a rolling pin."
        }
        ,{
          "@type": "HowToStep",
          "text": "Spread a generous amount of caramel on each slice."
        }
        ,{
          "@type": "HowToStep",
          "text": "Place a few pieces of banana at the bottom and roll it up tight."
        }
        ,{
          "@type": "HowToStep",
          "text": "Whisk the eggs together in a small bowl."
        }
        ,{
          "@type": "HowToStep",
          "text": "Dip the roll-up into the egg and then biscuit crumbs."
        }
        ,{
          "@type": "HowToStep",
          "text": "Fry over a medium heat in butter for 2-3 minutes each side."
        }
        ,{
          "@type": "HowToStep",
          "text": "Serve with a dollop of whipped cream and some finely grated chocolate."
        }
        ,{
          "@type": "HowToStep",
          "text": "Enjoy!"
        }
    ],
