    "recipeIngredient": [
          "Canola oil, to fry"
          ,"1 pound flank steak"
          ,"1 teaspoon taco seasoning"
          ,"2 teaspoons lime juice, divided"
          ,"2 teaspoons salt, divided"
          ,"2 avocados"
          ,"1 bag frozen french fries"
          ,"¼ cup Mexican sour cream"
          ,"1 8 ounce bags of flaming hot cheetos"
    ],
    "recipeInstructions": [
        {
          "@type": "HowToStep",
          "text": "Cut flank steak into fajita size pieces and place in bowl. Add the taco seasoning, 1 teaspoon lime juice and salt. Let marinate for 30 minutes."
        }
        ,{
          "@type": "HowToStep",
          "text": "Scoop avocado with a spoon and place in a bowl. Add 1 teaspoon lime juice, salt and mash with a fork until soft enough to whisk."
        }
        ,{
          "@type": "HowToStep",
          "text": "In a frying pan, add 1 tablespoon of canola oil and let heat for 30 seconds. Add marinated meat and let cook for 20 minutes, stirring until meat is browned."
        }
        ,{
          "@type": "HowToStep",
          "text": "In a small saucepan heat condensed cheddar cheese for 3 minutes, stir throughout."
        }
        ,{
          "@type": "HowToStep",
          "text": "Heat a pot with oil and heat to 350ºF (180ºF). Add frozen french fries and let fry until they rise to the surface. Sprinkle with salt and let oil drain from fries and set on a plate."
        }
        ,{
          "@type": "HowToStep",
          "text": "Add the rest of the guacamole, cooked meat, sour cream, hot cheetos, and warm cheddar cheese."
        }
        ,{
          "@type": "HowToStep",
          "text": "Enjoy!"
        }
    ],
