    "recipeIngredient": [
          "6 boneless, skinless, chicken thighs"
          ,"Salt, to taste"
          ,"Pepper, to taste"
          ,"1 tablespoon garlic, minced"
          ,"1 tablespoon dried parsley"
          ,"1 tablespoon butter"
          ,"6 large onions, thinly sliced"
          ,"1 teaspoon fresh thyme,"
          ,"1 cup beef stock"
          ,"2 cups shredded Gruyère cheese"
          ,"Bread, sliced and toasted, to serve"
    ],
    "recipeInstructions": [
        {
          "@type": "HowToStep",
          "text": "In a bowl, add the chicken thighs, salt, pepper, garlic, dried parsley, and olive oil, and toss until evenly coated."
        }
        ,{
          "@type": "HowToStep",
          "text": "Add the chicken to a skillet on medium-high heat. Sear until golden brown, about 4 minutes. Flip and cook the other side of the chicken, 2 minutes. Remove the chicken from the pan and set aside."
        }
        ,{
          "@type": "HowToStep",
          "text": "Preheat oven to broil."
        }
        ,{
          "@type": "HowToStep",
          "text": "Add the butter, sliced onions, salt, and pepper to the same pan, stirring occasionally until softened. Reduce heat to low and cook until they are deeply caramelized, about 1 hour."
        }
        ,{
          "@type": "HowToStep",
          "text": "Add thyme and beef broth and bring the mixture to a simmer."
        }
        ,{
          "@type": "HowToStep",
          "text": "Add the chicken on top of the onions, and sprinkle with Gruyère cheese."
        }
        ,{
          "@type": "HowToStep",
          "text": "Broil for 5 minutes, until the cheese is melted and golden brown."
        }
        ,{
          "@type": "HowToStep",
          "text": "Serve over bread."
        }
        ,{
          "@type": "HowToStep",
          "text": "Enjoy!"
        }
    ],
