    "image": "https://img.buzzfeed.com/video-api-prod/assets/065df47d92a94bd8bc8ae60c3546dcb2/IMG_0045_fb.jpg",
    "name": "Creamy Potato Kale Gratin Recipe by Tasty",
    "publisher": {
      "@type": "Organization",
      "name": "Tasty",
      "logo": {
        "@type": "ImageObject",
        "url": "/static-assets/img/favicon.b3bba8bf837f3cc2436736a18d4c4e6d.ico"
      }
    },
    "recipeIngredient": [
          "1½ -2 pounds russet potatoes, washed and peeled"
          ,"1 bunch kale, washed"
          ,"¼ cup parmesan cheese, shredded"
          ,"¼ cup Gruyère cheese, shredded"
          ,"¼ cup bread crumbs"
          ,"2 tablespoons butter"
          ,"2 cloves garlic"
          ,"2 tablespoon flour"
          ,"1½ cups milk"
          ,"1 teaspoon salt"
          ,"1 teaspoon pepper"
    ],
    "recipeInstructions": [
        {
          "@type": "HowToStep",
          "text": "Thinly sliced the potatoes, roughly ¼-inch (5mm) thick."
        }
        ,{
          "@type": "HowToStep",
          "text": "Remove stems from kale and cut into ¾ inch-1 inch (2 cm) pieces."
        }
        ,{
          "@type": "HowToStep",
          "text": "For the Béchamel sauce, add butter and garlic to a saucepan on medium heat and sauté until aromatic."
        }
        ,{
          "@type": "HowToStep",
          "text": "Add flour and mix until mixture browns slightly."
        }
        ,{
          "@type": "HowToStep",
          "text": "Add milk, salt, and pepper and simmer on low heat until mixture thickens."
        }
        ,{
          "@type": "HowToStep",
          "text": "In a medium-sized oven dish, lay a hefty bed of kale adding olive oil, salt, and pepper and gently mixing."
        }
        ,{
          "@type": "HowToStep",
          "text": "Starting from one side layer your potatoes across the kale covering the entire dish."
        }
        ,{
          "@type": "HowToStep",
          "text": "Gently press the potatoes and kale mixture down to make more room in the dish."
        }
        ,{
          "@type": "HowToStep",
          "text": "Drizzle half of the Béchamel sauce across all of the potatoes."
        }
        ,{
          "@type": "HowToStep",
          "text": "Repeat the process and add another layer of kale, olive oil, salt, pepper, and potatoes and cover with remaining sauce."
        }
        ,{
          "@type": "HowToStep",
          "text": "Garnish to taste with parmesan, Gruyère, and bread crumbs"
        }
        ,{
          "@type": "HowToStep",
          "text": "Bake at 350°F (180°C) for 30 minutes covered. Remove cover and bake an additional 30 minutes."
        }
        ,{
          "@type": "HowToStep",
          "text": "Enjoy!"
        }
    ],
