    "description": "Here's what you need: boneless, skinless chicken breast, salt, pepper, garlic powder, onion powder, swiss cheese, ham, peanut oil, all-purpose flour, egg, panko bread crumbs, butter, garlic, all-purpose flour, milk, dijon mustard, shredded parmesan cheese, salt, pepper",
    "image": "https://img.buzzfeed.com/thumbnailer-prod-us-east-1/video-api/assets/97867.jpg",
    "name": "Crispy, Creamy Chicken Cordon Bleu Recipe by Tasty",
    "publisher": {
      "@type": "Organization",
      "name": "Tasty",
      "logo": {
        "@type": "ImageObject",
        "url": "/static-assets/img/favicon.b3bba8bf837f3cc2436736a18d4c4e6d.ico"
      }
    },
    "recipeIngredient": [
          "4 boneless, skinless chicken breasts"
          ,"Salt, to taste"
          ,"Pepper, to taste"
          ,"1 tablespoon garlic powder"
          ,"1 tablespoon onion powder"
          ,"16 slices Swiss cheese"
          ,"½ pound sliced ham"
          ,"n/a"
          ,"1 cup flour"
          ,"4 eggs"
          ,"2 cups panko bread crumbs"
          ,"3 tablespoons butter"
          ,"2 cloves garlic, minced"
          ,"3 tablespoons flour"
          ,"2 cups milk"
          ,"¼ cup Dijon mustard"
          ,"1 cup shredded Parmesan cheese"
          ,"n/a"
          ,"n/a"
    ],
    "recipeInstructions": [
        {
          "@type": "HowToStep",
          "text": "Sprinkle the chicken breasts with salt, pepper, garlic powder, and onion powder, tossing to coat evenly."
        }
        ,{
          "@type": "HowToStep",
          "text": "On a cutting board, place a chicken breast between two sheets of plastic wrap and pound until about ½ inch (1 cm) thick with a meat mallet, rolling pin, or heavy pan."
        }
        ,{
          "@type": "HowToStep",
          "text": "Remove the plastic wrap and place 2 slices of Swiss cheese, then 2 slices of ham, then another layer of Swiss cheese, and another layer of ham. Evenly roll the chicken and place onto a new sheet of plastic wrap."
        }
        ,{
          "@type": "HowToStep",
          "text": "Wrap the chicken in the plastic wrap tightly and use the excess plastic on the sides to twist, firming up the roll of chicken cordon bleu as you work. Tie the excess plastic. Repeat with the remaining ingredients, then chill the rolls in the fridge to set for 30 minutes."
        }
        ,{
          "@type": "HowToStep",
          "text": "Meanwhile, preheat a tall-sided pan with 2 inches (5 cm) of oil to 325°F (170°C)."
        }
        ,{
          "@type": "HowToStep",
          "text": "After the rolls are set, prepare 2 separate large, wide dishes with the flour, beaten egg, and bread crumbs. Dredge the chicken first in the flour, then the egg, and then bread crumbs."
        }
        ,{
          "@type": "HowToStep",
          "text": "Place the breaded chicken cordon bleu in the oil and cook for about 5 minutes per side, or until the outside is an even golden brown. If a good color is achieved and the chicken’s center is still not 165°F (75°C), place the chicken cordon bleu on a wire rack set over a baking sheet and finish the chicken in the oven at 325°F (170°C) until that temperature is reached."
        }
        ,{
          "@type": "HowToStep",
          "text": "Meanwhile, prepare the sauce. In a 1 ½-quart saucepan over medium heat, melt the butter and cook the garlic until soft. Add the flour and whisk for 1 minute."
        }
        ,{
          "@type": "HowToStep",
          "text": "Add the milk and whisk until fully combined with the roux and no lumps remain. Continue whisking until the mixture comes to a simmer and has thickened."
        }
        ,{
          "@type": "HowToStep",
          "text": "Add the mustard, Parmesan cheese, salt, and pepper and whisk to combine. Remove the pan from the heat."
        }
        ,{
          "@type": "HowToStep",
          "text": "Slice the chicken and serve drizzled with Dijon sauce."
        }
        ,{
          "@type": "HowToStep",
          "text": "Enjoy!"
        }
    ],
