    "datePublished": "2018-10-23T20:09:19",
    "description": "Here's what you need: skin-on chicken leg quarter, kosher salt, black pepper, fresh thyme, bay leaf, fresh parsley stems, red burgundy wine, bacon, large carrot, large white onion, cremini mushroom, cremini mushroom, garlic, tomato paste, all-purpose flour, brandy, extra virgin olive oil, unsalted butter, pearl onion, sugar, fresh parsley, baguette",
    "image": "https://s3.amazonaws.com/video-api-prod/assets/80a6b2fb02484a7e947be0f867368840/fb1.jpg",
    "name": "Classic Coq Au Vin Recipe by Tasty",
    "publisher": {
      "@type": "Organization",
      "name": "Tasty",
      "logo": {
        "@type": "ImageObject",
        "url": "/static-assets/img/favicon.b3bba8bf837f3cc2436736a18d4c4e6d.ico"
      }
    },
    "recipeIngredient": [
          "4 pounds skin-on chicken leg quarters"
          ,"Kosher salt, to taste"
          ,"Black pepper, to taste"
          ,"3 sprigs of fresh thyme"
          ,"2 bay leaves"
          ,"¼ bunch fresh parsley stems"
          ,"3 cups red Burgundy wine or any dry red wine"
          ,"1 cup bacon, cubed"
          ,"3 large carrots, peeled and minced"
          ,"1 large white onion, chopped"
          ,"½ pound cremini mushrooms, sliced, plus ½ pound, quartered, divided"
          ,"n/a"
          ,"5 cloves garlic, minced"
          ,"2 tablespoons tomato paste"
          ,"2 tablespoons all-purpose flour"
          ,"¼ cup brandy"
          ,"2 tablespoons extra-virgin olive oil, plus more as needed"
          ,"2 tablespoons unsalted butter"
          ,"8 ounces pearl onions, peeled"
          ,"Pinch of sugar"
          ,"¼ cup chopped fresh parsley, for garnish"
          ,"1 baguette, sliced, for serving"
    ],
    "recipeInstructions": [
        {
          "@type": "HowToStep",
          "text": "In a large bowl, season the chicken with salt and pepper. Toss until well coated."
        }
        ,{
          "@type": "HowToStep",
          "text": "Tie the thyme sprigs, bay leaves, and parsley stems together with kitchen twine to make a bouquet garni."
        }
        ,{
          "@type": "HowToStep",
          "text": "Add the bouquet garni to the bowl with the chicken. Pour the wine over the chicken. Cover with plastic wrap and refrigerate for at least 2 hours or, even better, overnight."
        }
        ,{
          "@type": "HowToStep",
          "text": "In a large Dutch oven, cook the bacon over medium-low heat until the fat has rendered and the bacon is crisp, 15 minutes. Using a slotted spoon, transfer the bacon to a paper towel-lined plate, leaving any excess fat in the pot."
        }
        ,{
          "@type": "HowToStep",
          "text": "Remove the chicken from the marinade, reserving the liquid, and place on a paper towel-lined sheet pan. Pat the chicken with more paper towels until completely dry."
        }
        ,{
          "@type": "HowToStep",
          "text": "Heat the bacon fat over medium heat until nearly smoking. Working in batches, add the chicken legs skin-side down in a single layer and cook until well browned, 5 minutes per side. Remove the chicken from the pot and set aside."
        }
        ,{
          "@type": "HowToStep",
          "text": "Add the carrots, onion, sliced mushrooms, and garlic to the pot. Cook until the vegetables are softened and lightly browned, about 10 minutes."
        }
        ,{
          "@type": "HowToStep",
          "text": "Stir in the tomato paste and cook for 3 minutes, until darkened and fragrant. Then, sprinkle in the flour and cook for another minute, until incorporated."
        }
        ,{
          "@type": "HowToStep",
          "text": "Pour the brandy into the pot and cook, scraping up any browned bits at the bottom of the pot, until the liquid has evaporated, 2 minutes."
        }
        ,{
          "@type": "HowToStep",
          "text": "Add the reserved marinade, including the bouquet garni. Stir to incorporate, then bring to a boil and cook until the liquid is reduced by half, about 15 minutes. "
        }
        ,{
          "@type": "HowToStep",
          "text": "Return the chicken and half the cooked bacon to the pot. Cover, reduce the heat to low, and simmer for 1 hour, until the chicken is tender and the sauce has thickened."
        }
        ,{
          "@type": "HowToStep",
          "text": "Meanwhile, heat the olive oil and butter in a large, preferably nonstick skillet over medium-high heat. Add the pearl onions and a pinch of salt and sugar. Cover, reduce the heat to low, and cook for 15 minutes, shaking the skillet often to move the onions around."
        }
        ,{
          "@type": "HowToStep",
          "text": "Uncover, add the quartered mushrooms, and increase the heat to medium-high. Continue to cook until all the vegetables have softened, 5-8 minutes. Add the onions and mushrooms to the coq au vin."
        }
        ,{
          "@type": "HowToStep",
          "text": "Sprinkle with chopped parsley and the reserved bacon. Serve with crusty bread."
        }
        ,{
          "@type": "HowToStep",
          "text": "Enjoy!"
        }
    ],
