    "description": "Here's what you need: french bread, granny smith apple, brown sugar, cornstarch, egg, milk, vanilla, cinnamon, maple syrup, powdered sugar, whipped cream",
    "image": "https://img.buzzfeed.com/video-api-prod/assets/3870285915594ed083ae7ab2ce3093ee/BFV17798_AppleCinnamonFrenchToastBake-THUMB_FB1080.jpg",
    "name": "Apple Cinnamon French Toast Bake Recipe by Tasty",
    "publisher": {
      "@type": "Organization",
      "name": "Tasty",
      "logo": {
        "@type": "ImageObject",
        "url": "/static-assets/img/favicon.b3bba8bf837f3cc2436736a18d4c4e6d.ico"
      }
    },
    "recipeIngredient": [
          "12 ounces French bread, a day old"
          ,"2 Granny Smith apples, peeled"
          ,"1 cup brown sugar"
          ,"2 teaspoons cornstarch"
          ,"6 eggs"
          ,"2 cups milk"
          ,"1 teaspoon vanilla"
          ,"1 teaspoon cinnamon"
          ,"¼ cup maple syrup"
          ,"Powdered sugar, to taste"
          ,"Whipped cream, to taste"
    ],
    "recipeInstructions": [
        {
          "@type": "HowToStep",
          "text": "Cut the bread into 1-inch (2 ½ cm) cubes."
        }
        ,{
          "@type": "HowToStep",
          "text": "Dice peeled apples into small bite-size pieces."
        }
        ,{
          "@type": "HowToStep",
          "text": "Preheat the oven to 350˚F (180˚C)."
        }
        ,{
          "@type": "HowToStep",
          "text": "In a medium bowl, mix together the bread, apples, sugar, and cornstarch."
        }
        ,{
          "@type": "HowToStep",
          "text": "In a separate bowl, whisk together the eggs, milk, vanilla, and cinnamon."
        }
        ,{
          "@type": "HowToStep",
          "text": "Pour egg mixture into the bread bowl."
        }
        ,{
          "@type": "HowToStep",
          "text": "Give the ingredients a good stir, then pour into a 9x13-inch (33 cm X 23 cm) greased baking tray."
        }
        ,{
          "@type": "HowToStep",
          "text": "Drizzle with maple syrup."
        }
        ,{
          "@type": "HowToStep",
          "text": "Bake for 45 minutes or until golden brown."
        }
        ,{
          "@type": "HowToStep",
          "text": "Enjoy!"
        }
    ],
