    "description": "Here's what you need: heavy cream, vanilla extract, egg yolk, sugar, ramekins",
    "image": "https://s3.amazonaws.com/video-api-prod/assets/b6cef91dc4844a2893e14ce9eb200b77/thumb2.jpg",
    "name": "Homemade Crème Brûlée Recipe by Tasty",
    "publisher": {
      "@type": "Organization",
      "name": "Tasty",
      "logo": {
        "@type": "ImageObject",
        "url": "/static-assets/img/favicon.b3bba8bf837f3cc2436736a18d4c4e6d.ico"
      }
    },
    "recipeIngredient": [
          "4 cups heavy cream"
          ,"2 tsp vanilla extract"
          ,"6 egg yolks"
          ,"1 cup sugar, 1/2 cup in mixture and 1/2 cup for crust"
          ,"n/a"
    ],
    "recipeInstructions": [
        {
          "@type": "HowToStep",
          "text": "Heat heavy cream and vanilla extract in a sauce pan until hot, but not boiling."
        }
        ,{
          "@type": "HowToStep",
          "text": "In a medium bowl, whisk egg yolks and half of sugar until well mixed. Pour in the hot cream gradually, mixing continually."
        }
        ,{
          "@type": "HowToStep",
          "text": "Pour hot water into a large roasting pan. Place six ramekins into the pan (the water should come roughly halfway up the sides of the ramekins)."
        }
        ,{
          "@type": "HowToStep",
          "text": "Pour the egg mixture into the ramekins and bake at 325˚F (165˚C) for 45 - 50 minutes. The crème brûlée should be set, but still a little jiggly in the middle."
        }
        ,{
          "@type": "HowToStep",
          "text": "Remove the ramekins from the roasting pan, allow to cool to room temperature, cover with plastic wrap and refrigerate for at least two hours and up to three days."
        }
        ,{
          "@type": "HowToStep",
          "text": "Remove the crème brûlée from the refrigerator for at least 30 minutes before browning the sugar on top. Spread a tablespoon of sugar on top of each crème brûlée."
        }
        ,{
          "@type": "HowToStep",
          "text": "Using a torch, melt the sugar to for a crispy top. If you don’t have a torch, you can broil the crème brûlée to melt the sugar. Keep an eye on it, to make sure you don’t over cook it. Allow the crème brûlée to sit for at least five minutes before serving."
        }
        ,{
          "@type": "HowToStep",
          "text": "Enjoy!"
        }
    ],
