    "description": "Here's what you need: plain flour, cocoa powder, egg, butter, milk, strawberry, double cream, chocolate hazelnut spread, roasted crushed hazelnut",
    "image": "https://img.buzzfeed.com/video-api-prod/assets/c601eb357a304e94b39d212c9863fddf/square_thumb.jpg",
    "name": "Going Solo: 2 Crepe Crepe-Cakes Recipe by Tasty",
    "publisher": {
      "@type": "Organization",
      "name": "Tasty",
      "logo": {
        "@type": "ImageObject",
        "url": "/static-assets/img/favicon.b3bba8bf837f3cc2436736a18d4c4e6d.ico"
      }
    },
    "recipeIngredient": [
          "45 grams plain flour"
          ,"1 teaspoon cocoa powder"
          ,"1 egg"
          ,"10 grams melted butter"
          ,"100 millilitres milk"
          ,"150 grams strawberries, diced"
          ,"200 millilitres double cream"
          ,"4 tablespoons chocolate hazelnut spread"
          ,"1 teaspoon roasted crushed hazelnuts"
    ],
    "recipeInstructions": [
        {
          "@type": "HowToStep",
          "text": "In a bowl, whisk together the strawberries and double cream until they reach soft peaks."
        }
        ,{
          "@type": "HowToStep",
          "text": "Sieve the flour and cocoa powder into a bowl. Crack an egg in the middle and add the melted butter. Whisk until combined."
        }
        ,{
          "@type": "HowToStep",
          "text": "Slowly add the milk in three batches, whisking until perfectly smooth."
        }
        ,{
          "@type": "HowToStep",
          "text": "Heat a small amount of butter over low heat in a nonstick frying pan."
        }
        ,{
          "@type": "HowToStep",
          "text": "Pour in half of the mixture and swirl around until the pan is fully covered. When you can see bubbles forming underneath the crepe, flip. Cook until the edges start to look dry and crisp."
        }
        ,{
          "@type": "HowToStep",
          "text": "Repeat cooking steps with the remaining mixture and set aside to cool."
        }
        ,{
          "@type": "HowToStep",
          "text": "Spread the strawberry cream onto one crepe and chocolate hazelnut spread on the other."
        }
        ,{
          "@type": "HowToStep",
          "text": "Put the chocolate crepe on top of the strawberry one. Cut into 8 slices with a pizza cutter. Layer them on top of each other."
        }
        ,{
          "@type": "HowToStep",
          "text": "Serve with strawberries and crushed hazelnuts."
        }
        ,{
          "@type": "HowToStep",
          "text": "Nutrition  Calories: 2012 Fat: 146 grams  Carbs: 169 grams Fiber: 10 grams  Sugars: 52 grams  Protein: 38 grams"
        }
        ,{
          "@type": "HowToStep",
          "text": "Enjoy!"
        }
    ],
