    "description": "Here's what you need: black sesame seeds, powdered sugar, unsalted butter, glutinous rice flour, warm water, sugar, osmanthus",
    "image": "https://img.buzzfeed.com/thumbnailer-prod-us-east-1/video-api/assets/203426.jpg",
    "name": "Sweet Sesame Dumplings (Tangyuan) Recipe by Tasty",
