    "description": "Here's what you need: egg, salt, butter, fresh chives",
    "image": "https://img.buzzfeed.com/thumbnailer-prod-us-east-1/e6fcef631d704cfda005c8d3b9b0ca83/BFV29614_ClassicVsJapaneseOmelette-FB.jpg",
    "name": "French Omelette Recipe by Tasty",
    "publisher": {
      "@type": "Organization",
      "name": "Tasty",
      "logo": {
        "@type": "ImageObject",
        "url": "/static-assets/img/favicon.b3bba8bf837f3cc2436736a18d4c4e6d.ico"
      }
    },
    "recipeIngredient": [
          "3 eggs"
          ,"Salt, to taste"
          ,"1 tablespoon butter, unsalted"
          ,"Chives, to serve"
    ],
    "recipeInstructions": [
        {
          "@type": "HowToStep",
          "text": "Beat the eggs with the salt until the whites and the yolks are completely combined, with no spots of egg white remaining."
        }
        ,{
          "@type": "HowToStep",
          "text": "Over medium-low heat, melt the butter in a skillet, then pour in the eggs."
        }
        ,{
          "@type": "HowToStep",
          "text": "Using a rubber spatula, constantly scrape the bottom of the pan while shaking the pan in a circular motion to ensure that the eggs cook slowly, forming only small curds, about 1-2 minutes."
        }
        ,{
          "@type": "HowToStep",
          "text": "Once you start to see the bottom of the pan for more than a second after scraping, push the eggs into a round circular shape. Cook until the edges solidify, then tilt the pan and carefully roll the omelette on itself."
        }
        ,{
          "@type": "HowToStep",
          "text": "Invert onto a plate, then sprinkle with chives."
        }
        ,{
          "@type": "HowToStep",
          "text": "Serve immediately."
        }
        ,{
          "@type": "HowToStep",
          "text": "Enjoy!"
        }
    ],
