    "description": "Here's what you need: duck breast, sea salt, pepper, garlic, fresh rosemary, potato, butter, milk, orange zest, olive oil, salt, pepper, flour, red wine, cranberry sauce, honey, orange, chicken stock, salt, pepper, orange zest, fresh rosemary",
    "image": "https://img.buzzfeed.com/thumbnailer-prod-us-east-1/video-api/assets/123926.jpg",
