          "@type": "HowToStep",
          "text": "To a bowl, add the sliced Japanese eggplant, yellow squash, zucchini, Roma tomatoes, garlic, 1 tablespoon thyme, salt, pepper, and 2 tablespoons olive oil, and gently toss to combine."
