    "description": "Here's what you need: diced beef, plain flour, olive oil, onion, carrot, celery, tomato puree, garlic, fresh rosemary, chopped tomato, red wine, beef stock, large potato, butter, salt, pepper, fresh thyme, gruyère cheese",
    "image": "https://img.buzzfeed.com/video-api-prod/assets/02e1c193494d46f09676fec686a0fe06/BFV13315_BeefStewGratin-ThumbTextless1080.jpg",
    "name": "Beef Stew Gratin Recipe by Tasty",
    "publisher": {
      "@type": "Organization",
      "name": "Tasty",
      "logo": {
        "@type": "ImageObject",
        "url": "/static-assets/img/favicon.b3bba8bf837f3cc2436736a18d4c4e6d.ico"
      }
    },
    "recipeIngredient": [
          "500 grams diced beef"
          ,"50 grams plain flour"
          ,"Olive oil"
          ,"1 onion, diced"
          ,"2 carrots, diced"
          ,"2 celery stems, diced"
          ,"2 tablespoons tomato puree"
          ,"2 garlic cloves, minced"
          ,"Pinch of rosemary"
          ,"200 grams chopped tomato"
          ,"125 millilitres red wine"
          ,"300 millilitres beef stock"
          ,"2 large potatoes, thinly chopped"
          ,"2 tablespoons melted butter"
          ,"Salt"
          ,"Pepper"
          ,"Thyme"
          ,"50 grams grated gruyere"
    ],
    "recipeInstructions": [
        {
          "@type": "HowToStep",
          "text": "Preheat oven to 180°C (350˚F)."
        }
        ,{
          "@type": "HowToStep",
          "text": "Add salt and pepper to the flour and use it to coat the diced beef. Brown off beef in a deep ovenproof pan with olive oil. Remove from pan."
        }
        ,{
          "@type": "HowToStep",
          "text": "Add more oil and fry the onions until translucent. Add the carrots and celery and fry for another 3-5 minutes. Add the garlic and fry for 2 minutes together with the beef."
        }
        ,{
          "@type": "HowToStep",
          "text": "Add in the tomato puree and rosemary and fry for a further 2-3 minutes. Add the chopped tomato and cook for 2 minutes."
        }
        ,{
          "@type": "HowToStep",
          "text": "Add the red wine and allow to reduce slightly. Add the beef stock and allow to reduce for 10 minutes."
        }
        ,{
          "@type": "HowToStep",
          "text": "Cover the pot with a lid and cook for 2 hours."
        }
        ,{
          "@type": "HowToStep",
          "text": "Remove and cover the top of the stew with thinly-chopped peeled potatoes, arranged so they are overlapping slightly."
        }
        ,{
          "@type": "HowToStep",
          "text": "Cover with melted butter, salt, pepper, and thyme and cook for a further 45 minutes at 200°C (400˚F) with the lid off."
        }
        ,{
          "@type": "HowToStep",
          "text": "Remove from oven once potatoes are cooked and cover with the grated gruyere. Grill on high for 5-10 minutes until cheese is bubbling."
        }
        ,{
          "@type": "HowToStep",
          "text": "Enjoy!"
        }
    ],
