    "description": "Here's what you need: eggplant, roma tomatoes, yellow squash, zucchini, olive oil, onion, garlic, red bell pepper, yellow bell pepper, salt, pepper, can of crushed tomatoes, chopped fresh basil, chopped fresh basil, garlic, Chopped fresh parsley, fresh thyme, salt, pepper, olive oil",
