    "recipeIngredient": [
          "2 pounds chicken breasts"
          ,"2 teaspoons kosher salt, plus more to taste"
          ,"1½ teaspoons pepper, plus more to taste"
          ,"½ cup all-purpose flour"
          ,"4 teaspoons dried oregano, divided"
          ,"4 teaspoons onion powder, divided"
          ,"4 teaspoons dried basil, divided"
          ,"4 teaspoons garlic powder, divided"
          ,"2 large eggs"
          ,"2 cups panko bread crumbs, divided"
          ,"½ cup canola oil"
          ,"8 slices deli ham, sliced"
          ,"¼ cup shredded Gruyère cheese"
          ,"8 oven-ready lasagna noodles"
          ,"Finely chopped fresh parsley, for garnish"
          ,"n/a"
          ,"6 tablespoons all-purpose flour"
          ,"4 cups milk, warm"
          ,"1½ cups ounces shredded Gruyère cheese"
          ,"1½ cups ounces shredded Swiss cheese"
          ,"2 teaspoons kosher salt"
    ],
    "recipeInstructions": [
        {
          "@type": "HowToStep",
          "text": "Preheat the oven to 350°F (180°C)."
        }
        ,{
          "@type": "HowToStep",
          "text": "Slice the chicken breasts in half into cutlets and season with salt and pepper."
        }
        ,{
          "@type": "HowToStep",
          "text": "In a medium bowl, whisk together the flour, salt, pepper, 2 teaspoons oregano, 2 teaspoons onion powder, 2 teaspoons basil, and 2 teaspoons garlic powder."
        }
        ,{
          "@type": "HowToStep",
          "text": "In another medium bowl, beat the eggs."
        }
        ,{
          "@type": "HowToStep",
          "text": "In another medium bowl, combine 1½ cups (75 G) of panko bread crumbs, the remaining 2 teaspoons garlic powder, 2 teaspoons basil, 2 teaspoons onion powder, and 2 teaspoons oregano."
        }
        ,{
          "@type": "HowToStep",
          "text": "In a large skillet, heat the canola oil over medium-high heat."
        }
        ,{
          "@type": "HowToStep",
          "text": "Bread the chicken cutlets by coating in the flour mixture, then in the egg, and finally in the panko."
        }
        ,{
          "@type": "HowToStep",
          "text": "Working in batches, fry the breaded cutlets in the hot oil for 2 minutes on each side, until golden brown and cooked through. Transfer to a paper towel-lined plate to drain."
        }
        ,{
          "@type": "HowToStep",
          "text": "Make the cheese sauce: In a small saucepan over medium heat, whisk together the butter and flour. Cook until the flour is golden brown, about 2 minutes."
        }
        ,{
          "@type": "HowToStep",
          "text": "Slowly whisk in the warm milk until fully incorporated. Bring to a boil, then reduce the heat to low and simmer until thickened, about 3 minutes."
        }
        ,{
          "@type": "HowToStep",
          "text": "Turn off the heat and whisk in the Gruyère and Swiss cheeses until completely melted. Add the salt and stir to combine."
        }
        ,{
          "@type": "HowToStep",
          "text": "Spread about ⅓ of the sauce in the bottom of a  9x13-inch (22x30 cm) baking dish. Top with 4 lasagna noodles, 4 chicken cutlets, and 4 slices of ham. 13. Repeat to make another layer and then top with the remaining sauce."
        }
        ,{
          "@type": "HowToStep",
          "text": "Sprinkle the remaining ½ cup (25 G) of panko bread crumbs and the Gruyère cheese over the top."
        }
        ,{
          "@type": "HowToStep",
          "text": "Bake for 45-50 minutes, or until the top is golden brown and crispy."
        }
        ,{
          "@type": "HowToStep",
          "text": "Garnish with chopped parsley and serve."
        }
        ,{
          "@type": "HowToStep",
          "text": "Enjoy!"
        }
    ],
