    "@context": "http://schema.org/",
    "@type": "Recipe",
    "author": [
      {
        "@type": "Person",
        "name": "Tasty"
      }
    ],
    "datePublished": "2017-04-26T19:46:45",
    "description": "Here's what you need: apple, sugar, unsalted butter, salt, lemon, puff pastry, large muffin tin",
    "image": "https://img.buzzfeed.com/video-api-prod/assets/001792d12c7d4013b56ce8ad031fcf72/BFV5662_MiniCaramelAppleTarts-FB-thumb.jpg",
    "name": "Mini Caramel Apple Tarts (Tarte Tatin) Recipe by Tasty",
    "publisher": {
      "@type": "Organization",
      "name": "Tasty",
      "logo": {
        "@type": "ImageObject",
        "url": "/static-assets/img/favicon.b3bba8bf837f3cc2436736a18d4c4e6d.ico"
      }
    },
    "recipeIngredient": [
          "* 3 apples, preferably Pink Lady or Braeburn (for one muffin tin’s worth of apples)"
          ,"* 1 cup sugar"
          ,"* 2 Tbsp. unsalted butter"
          ,"* 1 tsp salt"
          ,"* 1/2 of a lemon"
          ,"* 1 sheet of puff pastry"
          ,"* A large muffin tin. We used this one."
    ],
    "recipeInstructions": [
        {
          "@type": "HowToStep",
          "text": "To begin, peel, halve, and core your apples (melon ballers make a good tool for coring halved apples). You’ll need one apple for every two tarts."
        }
        ,{
          "@type": "HowToStep",
          "text": "In a medium sauce pan, about 3 quarts (1 liter), slowly heat sugar. You’ll want to stir frequently until it dissolves into a brown syrup. Melt 1 tablespoon of butter into the sugar, stirring frequently. Add a dash of salt and the juice from ½ lemon."
        }
        ,{
          "@type": "HowToStep",
          "text": "Lower the heat as low as it will go and add your apple halves. Toss to coat with caramel and let simmer 5–10 minutes until tender, flipping once."
        }
        ,{
          "@type": "HowToStep",
          "text": "Cut puff pastry into circles to fit just within the top of your muffin tin."
        }
        ,{
          "@type": "HowToStep",
          "text": "Place apple halves curve-side down in a large muffin tin. Pour remaining caramel over each apple half. Top with a circle of puff pastry to fit just inside the muffin tin."
        }
        ,{
          "@type": "HowToStep",
          "text": "Bake 14–20 minutes at 450°F (230°C). Invert muffin pan onto baking sheet immediately. Serve with vanilla ice cream."
        }
        ,{
          "@type": "HowToStep",
          "text": "Enjoy!"
        }
    ],
