    "recipeIngredient": [
          "1 cup flour"
          ,"1 ½ cups milk"
          ,"2 eggs"
          ,"1 tablespoon melted butter"
          ,"2 tablespoons sugar"
          ,"Pinch of salt"
          ,"6 oz cream cheese, at room temperature"
          ,"2 tablespoons sugar"
          ,"1 teaspoon gelatin"
          ,"1 ½  cups heavy cream"
          ,"15 strawberries, sliced"
          ,"2 kiwis, sliced"
          ,"2 bananas, sliced"
          ,"n/a"
    ],
    "recipeInstructions": [
        {
          "@type": "HowToStep",
          "text": "Whisk together eggs, sugar and salt."
        }
        ,{
          "@type": "HowToStep",
          "text": "Sift in flour and mix. Add melted butter and mix."
        }
        ,{
          "@type": "HowToStep",
          "text": "Then gradually add the milk until no clumps remain."
        }
        ,{
          "@type": "HowToStep",
          "text": "In a nonstick skillet over medium heat, pour ¼ cup (60 ml) of crepe batter, and tip the pan in a circular motion to cover the entire bottom surface. Cook until the bottom surface of crepe begins to brown, then flip."
        }
        ,{
          "@type": "HowToStep",
          "text": "Repeat until all of the crepe batter is used. Cool crepes."
        }
        ,{
          "@type": "HowToStep",
          "text": "Combine cream cheese and sugar and whisk. Add gelatin and whisk until smooth."
        }
        ,{
          "@type": "HowToStep",
          "text": "Add whipped cream and mix well."
        }
        ,{
          "@type": "HowToStep",
          "text": "Stack crepes on top of each other, with cream and fruits (strawberry, kiwi, banana) between each layer."
        }
        ,{
          "@type": "HowToStep",
          "text": "Wrap cake in plastic. Refrigerate for 4 hours."
        }
        ,{
          "@type": "HowToStep",
          "text": "Top with sifted powdered sugar (optional)."
        }
        ,{
          "@type": "HowToStep",
          "text": "Enjoy!"
        }
    ],
