    "image": "https://img.buzzfeed.com/thumbnailer-prod-us-east-1/video-api/assets/154858.jpg",
    "name": "Crepe Triangle Pockets Recipe by Tasty",
    "publisher": {
      "@type": "Organization",
      "name": "Tasty",
      "logo": {
        "@type": "ImageObject",
        "url": "/static-assets/img/favicon.b3bba8bf837f3cc2436736a18d4c4e6d.ico"
      }
    },
    "recipeIngredient": [
          "2 cups all-purpose flour"
          ,"3 tablespoons granulated sugar"
          ,"3 large eggs"
          ,"¼ cup (½ stick) unsalted butter, melted"
          ,"3 cups whole milk"
          ,"10 tablespoons chocolate hazelnut spread"
          ,"1 cup whipped cream, plus more for serving"
          ,"1 banana, sliced"
          ,"5 halved strawberries"
    ],
    "recipeInstructions": [
        {
          "@type": "HowToStep",
          "text": "In a large bowl, stir together the flour, sugar, eggs, and melted butter."
        }
        ,{
          "@type": "HowToStep",
          "text": "Add ½ cup (120 ml) of milk at a time, stirring vigorously, making sure that each addition is completely incorporated and that the batter is smooth before adding more milk."
        }
        ,{
          "@type": "HowToStep",
          "text": "Strain the batter through a fine mesh sieve into another large bowl. The batter should be very liquidy and have no lumps. Rest in the fridge for at least 30 minutes, up to overnight."
        }
        ,{
          "@type": "HowToStep",
          "text": "In a medium nonstick pan over medium heat, pour ⅓ cup (80 ml) of the batter in the center, and swirl the batter around to reach the edges of the pan."
        }
        ,{
          "@type": "HowToStep",
          "text": "Cook the crêpe until bubbles rise to the surface and the bottom is golden brown, about 3 minutes. Flip and cook on the other side until the edges start to crisp slightly, about 1 minute more."
        }
        ,{
          "@type": "HowToStep",
          "text": "Transfer the crêpe to a wire rack to cool. Repeat with the remaining batter."
        }
        ,{
          "@type": "HowToStep",
          "text": "Cut the crêpes in half. Spread chocolate hazelnut spread or whipped cream evenly over each crepe half, then place a slice of banana or strawberry half on the right edge. Fold up the bottom of the crêpe, then fold toward the left side to make triangular shape. Repeat with the remaining ingredients."
        }
        ,{
          "@type": "HowToStep",
          "text": "Serve with whipped cream."
        }
        ,{
          "@type": "HowToStep",
          "text": "Enjoy!"
        }
    ],
