    "image": "https://img.buzzfeed.com/video-api-prod/assets/7f73f8d45dc04264bb1bf1ba7c615338/SugarGlazedAppleTart_FB_Thumbnail.jpg",
    "name": "Sugar-Glazed Apple Tart Recipe by Tasty",
    "publisher": {
      "@type": "Organization",
      "name": "Tasty",
      "logo": {
        "@type": "ImageObject",
        "url": "/static-assets/img/favicon.b3bba8bf837f3cc2436736a18d4c4e6d.ico"
      }
    },
    "recipeIngredient": [
          "• 2/3 cup all-purpose flour"
          ,"• 3 Tablespoons cold unsalted butter, cut into 3 equal pieces"
          ,"• 1 Tablespoon canola oil"
          ,"• 1/2 teaspoon sugar"
          ,"• 1/8 teaspoon salt"
          ,"• 1 Tablespoon ice-cold water"
          ,"• 2 apples, cut into slices"
          ,"• 2 Tablespoons sugar (Topping)"
          ,"• 3 Tablespoons butter, cut into small cubes (Topping)"
    ],
    "recipeInstructions": [
        {
          "@type": "HowToStep",
          "text": "Preheat the oven to 400°F (200°C)."
        }
        ,{
          "@type": "HowToStep",
          "text": "For the dough, put the flour, butter, oil, sugar, and salt in a food processor and process for about 10 seconds."
        }
        ,{
          "@type": "HowToStep",
          "text": "Add the Tablespoon of ice water and process for another five or six seconds."
        }
        ,{
          "@type": "HowToStep",
          "text": "Remove from the bowl and form into a flat dough. Wrap the dough with plastic wrap and then refrigerate for 20-30 minutes."
        }
        ,{
          "@type": "HowToStep",
          "text": "Lightly flour a work surface and roll the ball of dough into a thin layer, around ¼ inch (6 ⅓ mm) thick."
        }
        ,{
          "@type": "HowToStep",
          "text": "Using a round cutter, or use a round bowl or lid as a guide and cut out into a nice round circle. Carefully transfer the dough to a large cookie sheet lined with a nonstick baking mat."
        }
        ,{
          "@type": "HowToStep",
          "text": "Arrange the apple slices, alternating them nicely on top of the dough. Sprinkle the apple with sugar and put butter cubes on top."
        }
        ,{
          "@type": "HowToStep",
          "text": "Bake for 30 to 35 minutes, until the fruit is soft and the dough nicely browned."
        }
        ,{
          "@type": "HowToStep",
          "text": "Some of the juice from the fruit will have leaked out onto the cookie sheet. Before it hardens and makes the disks stick to the sheet, lift the tart with a broad spatula and transfer them to a cooling rack or platter."
        }
        ,{
          "@type": "HowToStep",
          "text": "Serve lukewarm or at room temperature with ice cream (optional)."
        }
        ,{
          "@type": "HowToStep",
          "text": "Enjoy!"
        }
    ],
