    "description": "Here's what you need: heavy cream, chocolate sandwich cookie, vanilla extract, egg yolk, sugar",
    "image": "https://img.buzzfeed.com/video-api-prod/assets/2959d6d634444274be972b6d0ba6bdaa/ThumbA.jpg",
    "name": "Cookies and Crème Brûlée Recipe by Tasty",
    "publisher": {
      "@type": "Organization",
      "name": "Tasty",
      "logo": {
        "@type": "ImageObject",
        "url": "/static-assets/img/favicon.b3bba8bf837f3cc2436736a18d4c4e6d.ico"
      }
    },
    "recipeIngredient": [
          "4 cups heavy cream"
          ,"16 chocolate sandwich cookies"
          ,"2 teaspoons vanilla"
          ,"6 egg yolks"
          ,"1 cup sugar"
    ],
    "recipeInstructions": [
        {
          "@type": "HowToStep",
          "text": "Separate sandwich cookies by gently twisting them apart. Put the cookies in one bowl and the filling in another."
        }
        ,{
          "@type": "HowToStep",
          "text": "In a saucepan over medium heat, heat heavy cream and cream filling, whisking until the filling has melted but stopping just before boil."
        }
        ,{
          "@type": "HowToStep",
          "text": "Add vanilla and remove from heat. Cover and set aside."
        }
        ,{
          "@type": "HowToStep",
          "text": "In a bowl, whisk egg yolks and half of the sugar. Add the cream mixture a little at a time, tempering the egg yolks until all incorporated."
        }
        ,{
          "@type": "HowToStep",
          "text": "Preheat oven to 300°F (150°C)."
        }
        ,{
          "@type": "HowToStep",
          "text": "Place ramekins on a baking pan and fill to the top with cream mixture."
        }
        ,{
          "@type": "HowToStep",
          "text": "In a ziplock bag, crush the cookies until fine."
        }
        ,{
          "@type": "HowToStep",
          "text": "Sprinkle 1 tablespoon of the cookie crumbs over each ramekin."
        }
        ,{
          "@type": "HowToStep",
          "text": "Fill the pan with boiling water."
        }
        ,{
          "@type": "HowToStep",
          "text": "Bake for 45 minutes."
        }
        ,{
          "@type": "HowToStep",
          "text": "Cover and refrigerate for 2 hours."
        }
        ,{
          "@type": "HowToStep",
          "text": "When set, add 2 teaspoons of sugar to the tops of the ramekins. Shake to make even, and broil or torch until the sugar is caramelized."
        }
        ,{
          "@type": "HowToStep",
          "text": "Enjoy!"
        }
    ],
