    "datePublished": "2017-10-10T13:39:10",
    "description": "Here's what you need: butter, chocolate, espresso powder, water, egg yolk, icing sugar, egg white, caster sugar, butter, cocoa powder",
    "image": "https://img.buzzfeed.com/thumbnailer-prod-us-east-1/video-api/assets/105852.jpg",
    "name": "Chocolate Espresso Soufflés Recipe by Tasty",
    "publisher": {
      "@type": "Organization",
      "name": "Tasty",
      "logo": {
        "@type": "ImageObject",
        "url": "/static-assets/img/favicon.b3bba8bf837f3cc2436736a18d4c4e6d.ico"
      }
    },
    "recipeIngredient": [
          "30 grams butter, melted"
          ,"80 grams chocolate, melted"
          ,"1 teaspoon espresso powder"
          ,"1 tablespoon water"
          ,"1 egg yolk"
          ,"1 tablespoon icing sugar"
          ,"1 egg white"
          ,"2 tablespoons caster sugar"
          ,"Softened butter, for greasing"
          ,"Cocoa powder, for dusting"
    ],
    "recipeInstructions": [
        {
          "@type": "HowToStep",
          "text": "Line 2 espresso cups or 2 small ramekins with softened butter followed by cocoa powder. Ensure all sides are coated with the cocoa as this will stabilise the sides of the soufflé when it rises."
        }
        ,{
          "@type": "HowToStep",
          "text": "In a large bowl, stir together the melted butter and melted chocolate until fully combined and smooth."
        }
        ,{
          "@type": "HowToStep",
          "text": "Stir in the espresso powder, followed by the water. "
        }
        ,{
          "@type": "HowToStep",
          "text": "Stir in the egg yolk."
        }
        ,{
          "@type": "HowToStep",
          "text": " Add in icing sugar. Stir until combined and smooth."
        }
        ,{
          "@type": "HowToStep",
          "text": "In a separate bowl, whisk the egg white until soft peaks form."
        }
        ,{
          "@type": "HowToStep",
          "text": "Gradually add the caster sugar and whisk until stiff peaks form and they become glossy."
        }
        ,{
          "@type": "HowToStep",
          "text": "Fold 2 tablespoons of the whipped egg whites into the chocolate mixture and fold until fully incorporated. Gradually fold in the remaining whipped egg whites. Be careful not to over stir, as this will knock the air out, which will stop the soufflé from rising to its full potential!"
        }
        ,{
          "@type": "HowToStep",
          "text": "Quickly pour the mixture into the prepared espresso cups or ramekins."
        }
        ,{
          "@type": "HowToStep",
          "text": "Using a knife, carefully pull across the top of each soufflé so that the top is completely flat."
        }
        ,{
          "@type": "HowToStep",
          "text": "Neaten the edges of the cups by running your thumb around the rim of the cup. This will help the soufflé to rise straight."
        }
        ,{
          "@type": "HowToStep",
          "text": "Chill the soufflés in the fridge for 30 minutes (optional) and then preheat the oven to 200°C (400°F)."
        }
        ,{
          "@type": "HowToStep",
          "text": "Bake for 15 minutes."
        }
        ,{
          "@type": "HowToStep",
          "text": "Dust with a little cocoa powder and serve immediately."
        }
        ,{
          "@type": "HowToStep",
          "text": "Enjoy!"
        }
    ],
    "recipeYield": "2 servings",
