    "recipeIngredient": [
          "1 English muffin"
          ,"1 tablespoon butter"
          ,"2 eggs"
          ,"1 tablespoon olive oil"
          ,"1 cup spinach"
          ,"2 pieces Canadian bacon"
          ,"Chives"
          ,"2 egg yolks"
          ,"1 tablespoon lemon juice"
          ,"1 teaspoon salt"
          ,"1 pinch cayenne"
          ,"½ cup butter, melted"
    ],
    "recipeInstructions": [
        {
          "@type": "HowToStep",
          "text": "Preheat oven to 400°F (200°C)."
        }
        ,{
          "@type": "HowToStep",
          "text": "In a sauté pan, heat the olive oil and add the spinach and a pinch of salt. Sauté until wilted. Set aside."
        }
        ,{
          "@type": "HowToStep",
          "text": "Butter the English muffin and toast in the oven for 5-10 minutes or until brown."
        }
        ,{
          "@type": "HowToStep",
          "text": "Heat a pot of water over medium heat. With a wooden spoon, swirl the water in the same direction."
        }
        ,{
          "@type": "HowToStep",
          "text": "Quickly add the egg into the center of the swirling water, cover, and cook for 3-5 minutes or until egg white is set and yolk is still runny."
        }
        ,{
          "@type": "HowToStep",
          "text": "Remove egg from water with a slotted spoon and set aside."
        }
        ,{
          "@type": "HowToStep",
          "text": "In a blender, add the egg yolks and pulse for one minute. Add in the lemon juice, salt, and cayenne and run the blender. Slowly add in the melted butter and continue to blend until the mixture lightens in color. Add more melted butter for thinner consistency."
        }
        ,{
          "@type": "HowToStep",
          "text": "Assemble the Benedict by layering the english muffin with the bacon, spinach, poached egg, and hollandaise sauce."
        }
        ,{
          "@type": "HowToStep",
          "text": "Top with fresh chives."
        }
        ,{
          "@type": "HowToStep",
          "text": "Enjoy!"
        }
    ],
