    "recipeIngredient": [
          "6 slices of Ham (Canadian-style Bacon)"
          ,"6 eggs"
          ,"3 egg yolks"
          ,"1/2 tsp white vinegar"
          ,"1/2 cup melted butter"
          ,"4 Tbsp. lemon juice"
          ,"A pinch of salt"
          ,"A pinch of black pepper"
          ,"3 English muffins (6 halves)"
    ],
    "recipeInstructions": [
        {
          "@type": "HowToStep",
          "text": "Egg Cups: Grease a large muffin tin. Place a slice of ham in each tin, then crack an egg over each slice of ham. Cover with tin  foil, then bake at 350˚F (175˚C) for 8-10 minutes (eight minutes if you like your yolk very runny)."
        }
        ,{
          "@type": "HowToStep",
          "text": "Hollandaise sauce: Fill the bottom of a double boiler part-way with water. Make sure that the water doesn’t touch the top bowl. Bring water to a gentle simmer. In the top of the double boiler, whisk together three egg yolks and ½ tsp white vinegar until well mixed."
        }
        ,{
          "@type": "HowToStep",
          "text": "Slowly pour the melted butter in the egg yolk mixture, a little at a time, while constantly whisking. If you pour too much too quickly without whisking, the mixture might not thicken or mix properly. If the hollandaise gets too thick, add a teaspoon or two of hot water. Continue whisking until all the butter is incorporated."
        }
        ,{
          "@type": "HowToStep",
          "text": "Remove from heat, whisk in lemon juice, salt, and pepper."
        }
        ,{
          "@type": "HowToStep",
          "text": "Place a toasted English muffin half down, layer the ham and egg cup on top of the English muffin, then drizzle your hollandaise sauce over the egg."
        }
        ,{
          "@type": "HowToStep",
          "text": "Enjoy!"
        }
    ],
